import './App.css';
import { Landing } from './Landing-page/Landing-page';
import { UploadDownload } from './Upload-Download-page/Upload-Download-page';

function App() {
  const ready = true;
  return (
    <div className="App">
      {
        ready ? (
          <UploadDownload/>
        ) : (
          <Landing/>
          )
      }
    </div>
  );
}

export default App;
